import LogoPL from "../../assets/images/PL.webp"
import { Link, NavLink } from "react-router-dom";
import { useState } from "react";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faHome, faUsers, faFlag, faSearch } from "@fortawesome/free-solid-svg-icons";
import { motion } from "framer-motion";
import "./index.scss";
import { logoVariants } from "../../animations/elementAnimations";

const Sidebar = () => {
    const [isActive, setIsActive] = useState(false);
    
    return (
        <div className="nav-bar">
            <Link className="logo" to="/">
                <motion.img 
                    src={LogoPL} 
                    alt="Logo"
                    variants={logoVariants}
                    whileHover="hover"
                />
            </Link>
            
            <nav className={isActive ? "mobile-show" : ""}>
                <NavLink exact="true" activeclassname="active" to="/" onClick={() => setIsActive(false)}>
                    <div className="nav-item">
                        <motion.div 
                            className="icon"
                            initial={{ opacity: 1 }}
                            whileHover={{ opacity: 0 }}
                        >
                            <FontAwesomeIcon icon={faHome} />
                        </motion.div>
                        <motion.div 
                            className="text"
                            initial={{ opacity: 0 }}
                            whileHover={{ opacity: 1 }}
                        >
                            HOME
                        </motion.div>
                    </div>
                </NavLink>
                
                <NavLink exact="true" activeclassname="active" to="/teams" onClick={() => setIsActive(false)}>
                    <div className="nav-item">
                        <motion.div 
                            className="icon"
                            initial={{ opacity: 1 }}
                            whileHover={{ opacity: 0 }}
                        >
                            <FontAwesomeIcon icon={faUsers} />
                        </motion.div>
                        <motion.div 
                            className="text"
                            initial={{ opacity: 0 }}
                            whileHover={{ opacity: 1 }}
                        >
                            TEAMS
                        </motion.div>
                    </div>
                </NavLink>
                
                <NavLink exact="true" activeclassname="active" to="/nations" onClick={() => setIsActive(false)}>
                    <div className="nav-item">
                        <motion.div 
                            className="icon"
                            initial={{ opacity: 1 }}
                            whileHover={{ opacity: 0 }}
                        >
                            <FontAwesomeIcon icon={faFlag} />
                        </motion.div>
                        <motion.div 
                            className="text"
                            initial={{ opacity: 0 }}
                            whileHover={{ opacity: 1 }}
                        >
                            NATIONS
                        </motion.div>
                    </div>
                </NavLink>
                
                <NavLink exact="true" activeclassname="active" to="/search" onClick={() => setIsActive(false)}>
                    <div className="nav-item">
                        <motion.div 
                            className="icon"
                            initial={{ opacity: 1 }}
                            whileHover={{ opacity: 0 }}
                        >
                            <FontAwesomeIcon icon={faSearch} />
                        </motion.div>
                        <motion.div 
                            className="text"
                            initial={{ opacity: 0 }}
                            whileHover={{ opacity: 1 }}
                        >
                            SEARCH
                        </motion.div>
                    </div>
                </NavLink>
            </nav>
            
            <div 
                className="hamburger-icon"
                onClick={() => setIsActive(!isActive)}
            >
                <span className={isActive ? "active" : ""}></span>
                <span className={isActive ? "active" : ""}></span>
                <span className={isActive ? "active" : ""}></span>
            </div>
        </div>
    )
}

export default Sidebar;
